    false,nt"url": null,nt"notes": "This data set contains lidar point data
    from a strip of Southern California coastline (including water, beach, cliffs, and
    top of cliffs) from Dana Point to Point La Jolla. The geographic extent of the data
    set is equivalent to the 18 quarter-quadrangles listed in Other_Citation_Details
    plus 30 meters of overedge beyond the extents of each quarter-quadrangle (overlap
    between quads). The data set was created by combining data collected using an Optech
    Inc. Airborne Laser Terrain Mapper (ALTM) 1225 in combination with geodetic quality
    Global Positioning System (GPS) airborne and ground-based receivers. The Bureau
    of Economic Geology, the University of Texas at Austin owns and operates an ALTM
    1225 system (serial number 99d118). The system was installed in a single engine
    Cessna 206 (tail number N4589U) owned and operated by the Texas State Aircraft Pooling
    Board. The lidar data set described by this document was collected on 9 September
    2002 (25202) between 22:44 and 02:02 UTC (see Lineage, Source_Information, Source_Contribution
    for pass information). Conditions on that day were clear skies, no fog or low clouds,
    but haze. 99d118 instrument settings for this flight were; laser pulse rate: 25kHz,
    scanner rate: 26Hz, scan angle: +/-20deg, beam divergence: narrow, altitude: 760-960m
    AGL, and ground speed: 99-110kts. Two GPS base stations (Scripps pier and San Onofre
    Power Plant, see Lineage, Source_Information, Source_Contribution for coordinates)
    were operating during the survey. Data represented is all points including terrain,
    vegetation, and structures. This data also contains returns from the water surface.
    No processing has been done to remove returns from terrain, vegetation, structures
    or water surfaces.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
